insert into products values (1, 'Apple MacBook Pro 14″ M2 Pro (Early 2023) – це друге покоління 14-дюймових MacBook Pro на базі чіпів Apple Silicon, представлені компанією Apple на початку 2023 року. Головним оновленням MacBook стали чіпи M2 Pro і M2 Max з якими ви отримаєте ще більше продуктивності, потужності та ефективності. Плюс до цього, MacBook Pro 14 (2023) має неймовірний дисплей Liquid Retina XDR 120Hz, велика кількість різноборазних портів, приголомшливий звук і покращену камеру. Нове покоління MacBook Pro 14 дасть вам ще більше потужності та автономності для роботи та розваг.', 'MacBook Pro 14', 'APPLE');
insert into products values (2, 'Apple MacBook Pro 16″ M2 (Early 2023) – це друге покоління 16-дюймових MacBook Pro на базі чіпів Apple Silicon, представлені компанією Apple на початку 2023 року. Головним оновленням MacBook стали чіпи M2 Pro і M2 Max з якими ви отримаєте ще більше продуктивності, потужності та ефективності Плюс до цього, MacBook Pro 16 (2023) має неймовірний дисплей Liquid Retina XDR 120Hz, велику кількість різноманітних портів, приголомшливий звук і покращену камеру.Нове покоління MacBook Pro 16 дасть вам ще більше потужності, автономності та розваг.', 'MacBook Pro 16', 'APPLE');
insert into products values (3, 'Dell XPS 17 9720 — мощный бизнес-ноутбук со стильным видом, тонким корпусом и мощной начинкой. Оснащен компонентами, которые соответствуют уровню продвинутых пользователей. Для работы и отдыха предоставляет 17-дюймовый сенсорный UHD+ экран, на котором можно будет просматривать результаты своей работы, любимый контент и ежедневно решать новые вопросы. Дизайн модели деловой, в некоторых элементах даже можно назвать строгим. Благодаря этому, ноутбук будет уместно смотреться на деловых встречах, совещаниях и в офисе, но при том так же будет удобным инструментом для работы дома. Широкий набор интерфейсов обеспечивает пользователя инструментами для передачи данных, а также подключение к Dell XPS 17 9720 различных периферийных устройств. Благодаря портам к ноутбуку можно будет подключить внешние накопители, флешки, мобильные гаджеты и прочее.', 'Dell XPS 17 9720 Platinum Silver', 'DELL');
insert into products values (4, 'Dell XPS 15 9520 — мощный бизнес-ноутбук со стильным видом, тонким корпусом и мощной начинкой. Оснащен компонентами, которые соответствуют уровню продвинутых пользователей. Для работы и отдыха предоставляет 15-дюймовый сенсорный UHD+ экран, на котором можно будет просматривать результаты своей работы, любимый контент и ежедневно решать новые вопросы. Дизайн модели деловой, в некоторых элементах даже можно назвать строгим. Благодаря этому, ноутбук будет уместно смотреться на деловых встречах, совещаниях и в офисе, но при том так же будет удобным инструментом для работы дома. Широкий набор интерфейсов обеспечивает пользователя инструментами для передачи данных, а также подключение к Dell XPS 15 9520 различных периферийных устройств. Благодаря портам к ноутбуку можно будет подключить внешние накопители, флешки, мобильные гаджеты и прочее.', 'Dell Xps 15 9520 Platinum Silver', 'DELL');
insert into products values (5, 'Будьте готовы, когда придет вдохновение. ZBook Studio — это высокопроизводительный и элегантный ПК, который вмещается в сумку. Он создан, чтобы помогать вам сосредоточиться. Создавайте сложные модели, воспроизводите содержимое в режиме реального времени или визуализируйте данные на ходу. Чем больше вы увидите, тем больше сделаете. Благодаря соотношению сторон 16:10 уменьшается необходимость прокрутки и отображается больший объем вертикального содержимого по сравнению с дисплеем 16:9. Теперь можно видеть больше приложений и приложений, которые используются ежедневно. Работайте с вдохновением где угодно. Тонкий и легкий ноутбук обладает достаточной мощностью, чтобы запускать нужное программное обеспечение в пути. Работайте вместе где угодно благодаря возможности автономной работы до 11 часов и программному обеспечению системы звука со средствами искусственного интеллекта, блокирующего шум. Процессор Intel Core позволяет параллельно использовать несколько ресурсоемких программ, не опасаясь, что они будут замедлять компьютер. Батарея заряжается очень быстро: от нуля до 50% всего за 30 минут. В творческом пылу всякое может случиться. Поэтому HP предусмотрели в клавиатуре сливное отверстие: если вы ненароком разольете над ним кофе, все стечет снизу, и разлитое можно будет легко вытереть.', 'HP ZBook Studio G9 Silver', 'HP');
insert into products values (6, 'Выполняйте проекты с большим объемом графики благодаря настольному процессору Intel и встроенной графике. Получите хранилище и память уровня настольного компьютера с возможностью расширения. Расширение легко благодаря доступу к компонентам без использования инструментов. Воплотите свои проекты в жизнь на великолепном дисплее и увидьте больше на экране благодаря дизайну с тонкой рамкой. Получите высочайшую производительность для ресурсоемких задач, таких как рендеринг и редактирование видео, с процессором Intel Core. Несчастные случаи случаются, поэтому HP разработали клавиатуру со сливным отверстием, чтобы небольшие пролитые жидкости вытекали через дно, что облегчает их очистку. Расширенные функции безопасности входят в стандартную комплектацию. Системные средства защиты, такие как HP Sure Start — первая в отрасли самовосстанавливающаяся система BIOS, — обеспечивают надежную защиту вашего устройства, а значит, и ваших данных и личных данных.', 'HP ZBook Fury 16 G9 Silver', 'HP');
insert into products values (7, 'Ноутбук ThinkPad P1 Gen 5 (21DC0011RA) - це мобільна робоча станція, розроблена, щоб задовольнити потреби професіоналів, які вимагають високої продуктивності, надійності та безпеки. Досконалий і компактний дизайн дозволяє легко носити його з собою, адже важить всього 1,8 кг, а вражаючий час автономної роботи гарантує, що ви зможете залишатися продуктивними протягом дня. Ноутбук ThinkPad P1 Gen 5 проходить тестування в екстримальних умовах навколишньго середовища, відповідно до військових стандартів США MIL-STD 810H і відповідає всім якостям дійсно надійного пристрою. Високо в небі і глибоко під землею, в жаркій пустелі, і в холодному кліматі. Волога, пісок, вібрація – ThinkPad P1 Gen 5 забезпечить стабільну роботу в найважчих умовах. Ноутбук ThinkPad P1 Gen 5 оснащений вбудованим пакетом безпеки ThinkShield, що захищає ваш дані та інформацію розміщену на пристрої. Дискретний модуль TPM 2.0 забезпечує шифрування даних та зберігає цифрові ключі шифрування, паролі та іншу конфіденційну інформацію. Лептоп обладнано сенсорним датчиком відбитку пальця, що інтегрований у кнопку живлення. IR-камерою, з Privacy Shutter, тому будь впевнений, доступ до інформації та пристрою отримаєш тільки ти, при чому швидко і без зайвих затримок. ThinkPad P1 Gen 5 має великий 16-дюймовий сенсорний дисплей WQUXGA IPS з яскравістю 600 ніт і 100% Adobe RGB, що робить його ідеальним для контент-креаторів, які потребують точного представлення кольорів. Дисплей також має антиблікове покриття, підтримку DisplayHDR 400 та Dolby Vision, забезпечуючи захоплюючий візуальний досвід. А сертифікат TÜV Low Blue Light, гарантує безпеку ваших очей та зменшення напруги при тривалому використанні. Під тонким і легким корпусом вбудований процесор 12-го покоління Intel Core i7-12800H з 14 ядрами та 20 потоками, що легко впорається з вимогливими професійними програмами. Завдяки архітектурі NVIDIA Ampere і 16 ГБ високошвидкісної пам''яті GDDR6, NVIDIA RTX A4500 забезпечує хорошу продуктивність та точність при рендерингу графіки високої якості, обробці великих об''ємів даних та швидкому розв''язанні складних обчислювальних завдань. Мобільна робоча станція поставляється з 32 ГБ оперативної пам’яті та SSD M.2 об''ємом 1 ТБ.', 'ThinkPad P1 Gen 5 Black', 'THINK_PAD');
insert into products values (8, 'ThinkPad P16 Gen 1 Storm Grey (21D6003QRA) – створено для тих, хто шукає потужну, витривалу, мобільну робочу станцію, що працює в будь-яких умовах. Славетна модель ноутбуків від Lenovo підкорила багато професіоналів і не збирається зупинятись. Стабільність роботи в умовах багатозадачності, 16-дюймовий дисплей з можливістю калібрування передачі кольорів та виняткова витривалість роботи в далеко не ідеальних, для ноутбуків, умовах праці. Тож не зупиняйся і ти, обирай ThinkPad P16 Gen 1 Storm Grey в оновленому дизайні, що здатний надихнути на втілення свіжих ідей. Ефективна робота можлива не тільки в офісі, а і в дорозі. Де б ти не був, що б не відбувалось навколо, ThinkPad P16 Gen 1 не підведе в роботі ні на мить. Мобільна робоча станція працює на базі процесорів 12-покоління Intel Core i9-12950HX, має SSD накопичувачем місткістю 1 ТБ, і 64 Гб оперативної пам''яті DDR5. Запускай вимогливі до ресурсів програми, займайся 3D моделюванням, працюй в декількох додатках, для тебе не існуватиме обмежень з портативною мобільною станцією, яка завжди буде під рукою. ThinkPad P16 Gen 1 може стабільно працювати в умовах високої вологості, вібрації, спеки, холоду, та навіть піщана буря його не зупинить. Він пройшов випробування на міцність і витривалість відповідно до стандартів Міністерства оборони США MIL-STD-810H, тож це дійсно міцний горішок, який не підведе тебе у складних умовах, коли треба діяти тут і зараз. Мобільна робоча станція ThinkPad P16 Gen 1 має 16-дюймовий IPS дисплей з роздільною здатністю 2560x1600 пікселів, а можливість калібрування передачі кольорів X-Rite Pantone Factory Color Calibration, дозволить побачити більше і передати потрібні кольори саме так, як ти цього потребуєш. За виведення графіки відповідає дискретна відеокарта NVIDIA RTX A4500 з 16 ГБ пам’яті. Насолоджуйся працюючи з графікою, або переглядом відео – деталізовані, чіткі лінії, чисте, плавне зображення без підвисань і розривів. З ThinkPad P16 Gen 1 тобі не треба хвилюватись за збереження конфіденційної інформації на пристрої. Для захисту всіх даних передбачено дискретний модуль ТРМ 2.0, який шифрує інформацію і захищає від доступу сторонніх осіб. Для додаткового захисту, а також швидкого входу й ідентифікації користувача, ThinkPad P16 Gen 1 має зчитувач відбитків пальців, що знаходиться у кнопці живлення, а також вбудовану IR-камеру зі шторкою приватності, яку за необхідності можна закрити. ThinkPad P16 Gen 1 представлений у стриманому темно-сірому кольорі, з виразною червоною лінією на корпусі. Корпус виготовлений з металу та стійкого до ударів пластику. Нова система охолодження направляє потік повітря не з боків, а у задню частину корпусу. З різних боків ноутбуку розміщені порти для підключення додаткової периферії. Два USB 3.2, один USB-C 3.2, один HDMI та два порти Thunderbolt 4. ', 'ThinkPad P16 Gen 1 Storm Grey', 'THINK_PAD');
